// HasChain applies the HasEdge predicate on the "chain" edge.
func HasChain() predicate.ChainHop {
	return predicate.ChainHop(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, ChainTable, ChainColumn),
		)
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.RoutingChain
		step.Edge.Schema = schemaConfig.ChainHop
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasChainWith applies the HasEdge predicate on the "chain" edge with a given conditions (other predicates).
func HasChainWith(preds ...predicate.RoutingChain) predicate.ChainHop {
	return predicate.ChainHop(func(s *sql.Selector) {
		step := newChainStep()
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.RoutingChain
		step.Edge.Schema = schemaConfig.ChainHop
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

