// And groups predicates with the AND operator between them.
func And(predicates ...predicate.ChainHop) predicate.ChainHop {
	return predicate.ChainHop(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.ChainHop) predicate.ChainHop {
	return predicate.ChainHop(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.ChainHop) predicate.ChainHop {
	return predicate.ChainHop(sql.NotPredicates(p))
}
